// 该文件是整个项目的入口文件

// 引入Vue
import Vue from 'vue'
// 引入App组件，它是所有组件的父组件
// import App from './App.vue'
// 关闭vue的生产提示
Vue.config.productionTip = false

// 创建Vue实例对象---vm
new Vue({
  el:'#app',
  // render: h => h(App), //将App组件放入容器中

  // 可有参数可无参数
  render(createElement) {
    console.log(createElement);
    // 必须有返回值
    return null
  },
  template:`
    <h1>你好啊</h1>
  `
})
